function getOrganic(t, top, api, s, tm)
{
    var parr = t.split(api);
    var pay = parr[1];
    pay = pay.substring(0, pay.length -1);


    var init_arr = pay.split(s);
    var partA = init_arr[0] + s;
    var arr = init_arr[1].split(tm);

    var SZ = arr.length;
    if(SZ > top) {
        SZ = top;
    }

    var counter =0;
    var js = "";
    var search_term = "";
    var validate_js = ""
    var vtext = "";
    for(const x in arr)
    {
        if(counter > SZ) {
            break;
        }
        else 
        if(x > 0) {

            search_term = tm + arr[x];

            try {
                vtext = search_term.substring(0, search_term.length-1);
                validate_js = JSON.parse(vtext);
            }
            catch(e) {
                search_term = "";
                SZ += 1;
            }
        }
        else
        {
            search_term = arr[0];
        }

        js += search_term
        counter +=1;
    }

    js = js.substring(0, js.length-1);
    js += ']}';

    var partB = js;
    js = partA + partB;

    return JSON.parse(js);
}

