function getSiteFollowers(country, visits, domain)
{
	var str = "";
	if(country === 1) {
		str =  visits + " στο " + domain + ", ";
	} 
	else if(country === 2) {
		str =  visits + " sur " + domain + ", ";
	} 
	else if(country === 3) {
		str =  visits + " в " + domain + ", ";
	} 
	else if(country === 4) {
		 str =  visits + " auf  " + domain + ", ";
	} 
	else if(country === 5) {
		str =  visits + " sa  " + domain + ", ";
	} 
	else {
		str =  visits + " on " + domain + ", ";
	}
	return str;
}

