function timeConvert(n) {
	const num = Number(n);
	var str = "";
	var hours =0;
	var rhours =0;
	var minutes =0;
	var rminutes =0;
	var seconds = 0;
	var rseconds = 0;
	if(num > 3600)
	{
		var nn = (num / 3600);
		var rn = Math.floor(nn);
		hours = (n - rn) * 3600;
		hours = (hours / 60);
		rhours = Math.floor(hours);
		minutes = (hours - rhours) * 60;
		rminutes = Math.round(minutes);

		seconds = (minutes - rminutes)*60;
		rseconds = Math.round(seconds);

		if(msg.COUNTRY === 1)
        {
            str = rhours + " ωρα & " + rminutes + " λεπτα & " + " " + rseconds + " δευτερολεπτα";
