        {
            str = rhours + " heure & " + rminutes + " minutes & " + " " + rseconds + " secondes";
        }
        else
        if(msg.COUNTRY === 3)
        {
            str = rhours + " час & " + rminutes + " минути & " + " " + rseconds + " секунди";
        }
        else
        if(msg.COUNTRY === 4)
        {
           str = rhours + " Stunde & " + rminutes + " Minuten & " + " " + rseconds + " Sekunden";
        }
        else
        if(msg.COUNTRY === 5)
        {
            // Philippines
           str = rhours + " ora & " + rminutes + " minuto & " + " " + rseconds + " segundo";
        }
        else
        {
            str = rhours + " hour & " + rminutes + " minutes & " + " " + rseconds + " seconds";
        }

	}
	else
	if(num > 60)
	{
		minutes = (num / 60);
		rminutes = Math.floor(minutes);
		seconds = (minutes - rminutes)*60;
		rseconds = Math.round(seconds);

		if(msg.COUNTRY === 1)
