            str = rminutes + " λεπτα & " + " " + rseconds + " δευτερολεπτα";
        }
        else
        if(msg.COUNTRY === 2)
        {
            str = rminutes + " minutes & " + " " + rseconds + " secondes";
        }
        else
        if(msg.COUNTRY === 3)
        {
            str = rminutes + " минути & " + " " + rseconds + " секунди";
        }
        else
        if(msg.COUNTRY === 4)
        {
           str = rminutes + " Minuten & " + " " + rseconds + " Sekunden";
        }
        else
        if(msg.COUNTRY === 5)
        {
            // Philippines
           str = rminutes + " minuto & " + " " + rseconds + " segundo";
        }
        else
        {
            str = rminutes + " minutes & " + rseconds + " seconds";
        }


	}
	else
	{
	    if(msg.COUNTRY === 1)
        {
            str = num + " δευτερολεπτα";
        }
        else
        if(msg.COUNTRY === 2)
        {
            str = num + " secondes";
        }
        else
        if(msg.COUNTRY === 3)
        {
            str = num + " секунди";
        }
        else
        if(msg.COUNTRY === 4)
        {
           str = num + " Sekunden";
        }
        else
        if(msg.COUNTRY === 5)
        {
            // Philippines
           str = num + " segundo";
        }
        else
        {
            str = num + " seconds";
        }

	}
	return str;
}

