function get2PreviousMonths(end_month)
{
	var endM = new Date(end_month);
	const endt = endM.toISOString().substring(0, 7);
	const end_1st_day = endt+"-01";

	var start_dt = new Date(end_1st_day);
	start_dt.setHours(start_dt.getHours() + 3); // GMT --> local time
	start_dt.setMonth(start_dt.getMonth() - 2);
	const start = start_dt.toISOString().substring(0, 10);

	var middle_dt = new Date(end_1st_day);
	middle_dt.setHours(middle_dt.getHours() + 3);	// GMT --> local time
	middle_dt.setMonth(middle_dt.getMonth() - 1);
	const middle = middle_dt.toISOString().substring(0, 10);

	var data = {
		start_date : start,
		middle_date : middle,
		end_date : end_month
	};

	return data;
}

